import React, { useState, useEffect } from 'react';
import Modal from 'react-modal';
import './Modal.css';

const CreateUserModal = ({ isOpen, onClose, onSave, initialFormData }) => {
  const [formData, setFormData] = useState({
    id: '',
    name: '',
    phone: '',
    email: '',
    status: 'active',
  });

  useEffect(() => {
    if (initialFormData) {
      setFormData(initialFormData);
    } else {
      setFormData({
        id: '',
        name: '',
        phone: '',
        email: '',
        status: 'active',
      });
    }
  }, [initialFormData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSave = () => {
    if (validateForm()) {
      onSave(formData);
      handleClose();
    } else {
      alert('Please fill out all required fields.');
    }
  };

  const validateForm = () => {
    return formData.id && formData.name && formData.phone && formData.email && formData.status;
  };

  const handleClose = () => {
    onClose();
    setFormData({
      id: '',
      name: '',
      phone: '',
      email: '',
      status: 'active',
    });
  };

  return (
    <Modal
      isOpen={isOpen}
      onRequestClose={handleClose}
      className="modal"
      overlayClassName="modal-overlay"
      aria={{
        labelledby: "modal-title",
        describedby: "modal-description"
      }}
    >
      <div className="modal-content">
        <span className="close" onClick={handleClose}>
          &times;
        </span>
        <div className="modal-header">
          <h2 id="modal-title">{initialFormData ? 'Update User' : 'Create User'}</h2>
        </div>
        <div className="modal-body">
          <form>
            <div className="form-group">
              <label>ID User:</label>
              <input
                type="text"
                name="id"
                value={formData.id}
                onChange={handleChange}
                readOnly={!!initialFormData} 
              />
            </div>
            <div className="form-group">
              <label>Name:</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
              />
            </div>
            <div className="form-group">
              <label>Phone:</label>
              <input
                type="text"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
              />
            </div>
            <div className="form-group">
              <label>Email:</label>
              <input
                type="text"
                name="email"
                value={formData.email}
                onChange={handleChange}
              />
            </div>
            <div className="form-group">
              <label>Status:</label>
              <select name="status" value={formData.status} onChange={handleChange}>
                <option value="active">Active</option>
                <option value="inactive">Inactive</option>
              </select>
            </div>
          </form>
        </div>
        <div className="modal-footer">
          <button className="cancel-button" onClick={handleClose}>
            Cancel
          </button>
          <button className="save-button" onClick={handleSave}>
            {initialFormData ? 'Update' : 'Create'}
          </button>
        </div>
      </div>
    </Modal>
  );
};

export default CreateUserModal;
